import React from 'react';
import PropTypes from 'prop-types';
import Star from './Star'

function Stars({count}) {
  return (
    count.map(coun => <Star/>)
    );
  
}

export default Stars;

Stars.PropTypes ={
    count: PropTypes.number.isRequired
};
